// 화면 import
import MemberCreate from '@/views/MemberCreate.vue'
import LoginPage from '@/views/MemberCreate.vue'

export const memberRouter = [
    {
        path: '/member/create',
        name: 'MemberCreate',
        component: MemberCreate
    },
    {
        path: '/login',
        name: 'LoginPage',
        component: LoginPage
    }
];
